import React from "react";
import {
  ContactContainer,
  LinkContainer,
  TwitterIcon,
  LinkedInIcon,
  GithubIcon,
  FacebookIcon,
} from "./Contact.style";
import { motion } from "framer-motion";
const Contact = () => {
  return (
    <ContactContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <FacebookIcon>
          <i
            style={{
              fontSize: "25px",
              lineHeight: "60px",
              textAlign: "center",
              width: "100%",
            }}
            class="fab fa-facebook-f"
          ></i>
        </FacebookIcon>
        <span>Facebook</span>
      </LinkContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <GithubIcon>
          <i
            class="fab fa-github"
            style={{ fontSize: "25px", lineHeight: "60px" }}
          ></i>
        </GithubIcon>
        <span>Github</span>
      </LinkContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <LinkedInIcon>
          <i
            style={{ fontSize: "25px", lineHeight: "60px" }}
            class="fab fa-linkedin-in"
          ></i>
        </LinkedInIcon>
        <span>LinkedIN</span>
      </LinkContainer>
      <LinkContainer whileHover={{ width: "200px" }}>
        <TwitterIcon>
          <i
            style={{ fontSize: "25px", lineHeight: "60px" }}
            class="fab fa-twitter"
          ></i>
        </TwitterIcon>
        <span>Twitter</span>
      </LinkContainer>
    </ContactContainer>
  );
};
export default Contact;
